create schema project;

create table project.passengers(
    passengers_id integer primary key,
    first_name    text NOT NULL,
    last_name     text NOT NULL,
    patronymic    text,
    br_date       date,
    passport      text NOT NULL
);


create table project.tickets(
    char_number     text,
    digit_number    integer,
    passenger_id    integer,
    first_name      text NOT NULL,
    last_name       text NOT NULL,
    patronymic      text,
    departure_date  date,
    departure_time  time,
    arrival_date    date,
    arrival_time    time,
    row             integer NOT NULL,
    row_letter      varchar(1) NOT NULL,
    gate            integer NOT NULL,
    class           text NOT NULL,
    constraint PK_Tickets PRIMARY KEY (char_number, digit_number, passenger_id),
    constraint FK_PassengersTicket FOREIGN KEY (passenger_id)
        references project.passengers(passengers_id)
);


create table project.airport(
    airport_name     text primary key,
    address          text,
    city             text NOT NULL,
    latitude         float8,
    longitude        float8
);


create table project.airline_company_at_airport(
    char_number     text,
    digit_number    integer,
    airport_name    text NOT NULL,
    company_name    text NOT NULL,
    constraint PK_AirlineCompanyAtAirport PRIMARY KEY (char_number, digit_number),
    constraint FK_AirportName FOREIGN KEY (airport_name)
        references project.airport(airport_name)
);

create table project.airline_company(
    plane_id        integer PRIMARY KEY ,
    company_name    text
);

create table project.plane(
    plane_id        integer PRIMARY KEY,
    commander_id    integer NOT NULL,
    model           text NOT NULL,
    type            text NOT NULL,
    first_name      text NOT NULL,
    last_name       text NOT NULL,
    patronymic      text,
    br_date         date,
    constraint FK_AirlinesPlanes FOREIGN KEY (plane_id)
        references project.airline_company(plane_id)
);



create table project.flights(
    char_number         text,
    digit_number        integer,
    type                text  NOT NULL,
    from_airport_name   text NOT NULL,
    to_airport_name     text NOT NULL,
    departure_date      date NOT NULL,
    departure_time      time NOT NULL,
    arrival_date        date NOT NULL,
    arrival_time        time NOT NULL,
    plane_id            integer NOT NULL,
    constraint PK_Flights PRIMARY KEY (char_number, digit_number),
    constraint FK_AirlineCompanyAtAirportFlights FOREIGN KEY (char_number, digit_number)
        references project.airline_company_at_airport(char_number, digit_number),
    constraint FK_PlanesFlights FOREIGN KEY (plane_id)
        references project.plane(plane_id)
);



alter table project.tickets add constraint FK_FlightsTickets FOREIGN KEY (char_number, digit_number)
    references project.flights(char_number, digit_number);


